        address recommender;
        // 记录用户的唯一号
        uint40 customerKey;
        // 记录用户的推荐人
        address Gater;
        uint32 GaterKey;
        // 客户地址
        address contractAddress;
        bool isUsed;
        bool unlock;
    }
}

